import React,{Component}from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import '../components/Home.css'

export default class ArcitectPage extends Component{
    constructor(props){
        super(props);
        
        this.state={Requests:[]};
    }
    componentDidMount(){
      //${this.props.userID}
        axios.get(`http://localhost:3000/Request/Userid/${this.props.User._id}`)
        .then(res=>{console.log(res.data)
         this.setState({Requests:res.data.Req})})
        .catch(err=>{console.log('Error'+err)})
    }

    RequestsList(){
        return this.state.Requests.map( currentRequests=>{
            return(
            <tr key={currentRequests._id}>
            <td>{currentRequests._id}</td>
            <td>{currentRequests.SVM}</td>
            <td>{currentRequests.status}</td>
            </tr>
            )})
    }
    render(){
        return(
        <div className="container-fluid d-flex justify-content-center">
            <div>
            <div className="jumbotron jumbotron-fluid">
                <div className="container">
                    <h1 className="display-4">Hello {this.props.User.Nickname}</h1>
                        <p className="lead">This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
                        <Link to={{pathname:"/RequsetAggre" ,aboutProps:{User:this.props.User}}} className="btn btn-primary btn-circle">Make a AggregateRequest</Link>
                        <Link to={{pathname:"/RequsetSvm" ,aboutProps:{User:this.props.User}}} className="btn btn-primary">Make a  SvmRequest </Link>
                        <Link to={{pathname:"/RequestVolume" ,aboutProps:{User:this.props.User}}} className="btn btn-primary">Make a VolumeRequest</Link>
                        <Link to={{pathname:"/Bug" ,aboutProps:{User:this.props.User}}} className="btn btn-info">Report a bug</Link>
                    </div>
                </div>
                <div>
                    <table className="table table-hover ">
                        <thead>
                            <tr className="table-primary">
                                <th scope="col">Request Number</th>
                                <th scope="col">Svm</th>
                                <th scope="col">Status</th>
                            </tr>
                        </thead>
                        <tbody className="table-striped">
                            {this.RequestsList()}
                        </tbody>
                    </table>
                </div>
            </div> 
        </div>
        )
    }
}
